@Override
public void sync(Collection<String> names) throws IOException {
  ensureOpen();
  Set<String> toSync = new HashSet<String>(names);
  toSync.retainAll(staleFiles);

  for (String name : toSync)
    fsync(name);

  staleFiles.removeAll(toSync);
}

